


<h2 class="text-center" style="margin-top: 6%;">Logs   <i class="fa fa-users"></i></h2>


<table class="table" style="margin-top: 2%;">
<thead>
<th>ID</th>
<th>URL</th>
<th>Date  <i class="fa fa-calendar"></i></th>
<th></th>
<th></th>
</thead>
<tbody>
<tr *ngFor="let log of logList">
<td id="{{log.id}}">{{log.id}}</td>
<td id="url">{{log.url}}</td>
<td id="date">{{log.date}}</td>
</tr>
</tbody>
</table>
